const { describe, it } = require('mocha')
const { expect } = require('chai')
const Run = require('../env/run')
const { COVER } = require('../env/config')
const { B } = Run.extra

// ------------------------------------------------------------------------------------------------
// B
// ------------------------------------------------------------------------------------------------

describe('B', () => {
  // Berries do not support cover tests yet
  if (COVER) return

  it('test', async () => {
    const rawtx = ''
    const blockchain = new Run.plugins.Mockchain()
    blockchain.fetch = async () => rawtx
    new Run({ blockchain }) // eslint-disable-line
    const b = await B.load('2f3492ef5401d887a93ca09820dff952f355431cea306841a70d163e32b2acad')
    expect(typeof b.base64Data).to.equal('string')
    expect(b.mediaType).to.equal('image/png')
    expect(b.encoding).to.equal('binary')
    expect(b.filename).to.equal('99e4ecd0-4488-11eb-b38a-2178d1454340.png')
  })

  // ------------------------------------------------------------------------

  it.skip('deploy', async () => {
    // Hint: Run with env NETWORK=<network> to deploy with keys
    const run = new Run()
    run.deploy(Run.extra.B)
    await run.sync()
    console.log(Run.extra.B)
  })
})

